・アイドリングストップ車の再始動時に低電圧になる場合でも警報を発生させない誤警報カット機能搭載。<br>・標準時刻電波を受信して自動的に時刻を合せる、時刻合せのいらない電波時計と「内気温度／電圧」、「外気温度／電圧」、「内気温度／外気温度」を表示する内外温度計・電圧計がオールインワンになりました。<br>・日本標準時刻電波40kHz&amp;60kHzの2局自動受信で、日本全域対応。<br>・電波を正しく受信する所では、高い時刻精度を保ちます。<br>・時刻の他に、カレンダー表示付で月、日、曜日を表示します。<br>・12時間表示と24時間表示の切替式です。<br>・アラームとLEDの光で電圧異常と路面凍結をお知らせします。（設定/解除できます）<br>・電圧と気温の最高/最低値のメモリー付きです。<br>・表示をブルー又はホワイトに切り替えできるので暗い所でもはっきり見えます。<br>・角度調整が自由にできる取付ステー付で取り付け場所を選びません。<br>・過電流保護として、カープラグにヒューズを内蔵しました。<br>・カープラグコード長約2m。<br>・外気温センサーコード長約3m。<style type="text/css">
