シンプルに使いやすく見やすさアップ！<br>LED発光表示タイプ。<br><br>コンパクトなサイズで置き場所にこまらない。<br><br>昼間/夜間でも優れた視認性を持つ、LEDを採用した電波時計です。<br>標準時刻電波を受信して自動的に時刻を合わせる、時刻合わせのいらない電波時計です。<br>エンジンオフ時など、シガープラグからの電源が供給されない状況でも、バックアップ電池によりLIGHTボタンを押すことで5秒間点灯し、時刻の確認ができます。<br><br>■仕様■<br>使用電源：主電源DC12V/バックアップ電源：CR2032<br>電池寿命：約1年(受信2回/日として）<br>表示内容：月/日/曜日/時/分/秒/電波レベル<br>自動受信：2回/日<br><br><br>●メーカー品番：Fizz-850<br>●メーカー名：ナポレックス / NAPOLEX<style type="text/css">
